function currentEquality() {
    this.lead1 = this.get("Lead1"),
    this.lead2 = this.get("Lead2");
    var self = this;
    (function () {
        return self.lead1.current + self.lead2.current == 0;
    }).shouldBeTrue({self: self})
}

