function supplyVoltage() {
    var supplyVoltage = this.get("UInput"),
        self = this;
    (function () {
        return (self.lead1.voltage - self.lead2.voltage ==
                self.lead1.current * supplyVoltage.getTextString());
    }).shouldBeTrue({supplyVoltage: supplyVoltage, self: self});
}

