function leadLabels() {
    var l1txt = this.get("Lead1Text"),
        l2txt = this.get("Lead2Text"),
        self = this;

    (function () {
        return l1txt.getTextString() == ("I: " + self.lead1.current +
                                         ", U: " + self.lead1.voltage);
    }).shouldBeSatisfiedWith(function () {
        l1txt.getTextString().formula([self.lead1.current, self.lead1.voltage],
            function (c, v) {
                return "I: " + c + ", U: " + v;
            }
        );
    }, {self: self, l1txt: l1txt});
    (function () {
        return l2txt.getTextString() == ("I: " + self.lead2.current +
                                         ", U: " + self.lead2.voltage);
    }).shouldBeSatisfiedWith(function () {
        l2txt.getTextString().formula([self.lead2.current, self.lead2.voltage],
            function (c, v) {
                return "I: " + c + ", U: " + v;
            }
        );
    }, {self: self, l2txt: l2txt});
}

